import React from 'react';
import image from "../src/images/instagram-logo.png"



class Navbar extends React.Component {
    render() {
      return (
        <div className="navbar">
            <div id="logo">
                <button>
                <i class="fab fa-instagram" height= "50px" width="50px"></i> 
                <img src = {image} height= "25px" width = "50px"/>
                </button>
            </div>

            <div id="search">
                <input type="text" placeholder= "Search"></input>
            </div>

            <div id="icons">
                <button> <i class="far fa-compass"> </i> </button>
                <button><i class="far fa-heart"></i></button>
                <button><i class="far fa-user"></i></button>
            </div>
        </div>
      )
    }
  }
  export default Navbar;
